import React from 'react';
import '../CSS/StaffModal.css'; // Create CSS file for modal styles

const StaffModal = ({ staff, onClose }) => {
  return (
    <div className="modalContainer">
      <div className="modalContent">
        <span className="closeButton" onClick={onClose}>&times;</span>
        <h2>{staff.name}</h2>
        <p>{staff.position}</p>
        <p>Contact No: {staff.contactNo}</p>
        {/* Add additional details or content as needed */}
      </div>
    </div>
  );
};

export default StaffModal;
